package cn.com.evo.integration.wasu.common.content;/** * @Description: * @author: lu.xin * @create: 2019-04-25 1:58 PM **/public class Segment {    private String beginTime;    private String endTyoem;    private String imageUrl;    private String name;    private String segmentId;    private String type;    public String getBeginTime() {        return beginTime;    }    public void setBeginTime(String beginTime) {        this.beginTime = beginTime;    }    public String getEndTyoem() {        return endTyoem;    }    public void setEndTyoem(String endTyoem) {        this.endTyoem = endTyoem;    }    public String getImageUrl() {        return imageUrl;    }    public void setImageUrl(String imageUrl) {        this.imageUrl = imageUrl;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getSegmentId() {        return segmentId;    }    public void setSegmentId(String segmentId) {        this.segmentId = segmentId;    }    public String getType() {        return type;    }    public void setType(String type) {        this.type = type;    }}